import axios from "axios";
import { useEffect, useState } from "react";
import Coin from "./component/Coin";
import Nav from "./component/Nav";
import { Route, Routes } from "react-router-dom";
import CoinDetails from "./component/CoinDetails";

//api key

function App() {
  const url =
    "https://api.coingecko.com/api/v3/coins/markets?vs_currency=usd&order=market_cap_desc&per_page=30&page=1&sparkline=false&locale=en";
  const [coins, setCoins] = useState([]);
  console.log(coins);

  useEffect(() => {
    axios.get(url).then((response) => setCoins(response.data));
  }, []);
  return (
    <div className="App">
      <Nav />
      <Routes>
        <Route path="/" element={<Coin coins={coins} />} />
        <Route path="/coin/:id" element={<CoinDetails />} />
      </Routes>
    </div>
  );
}

export default App;
